    true,nt"url": null,nt"notes": "U.S. Census Grids (Summary File 3), 1990:
    Metropolitan Statistical Areas contain grids of demographic and socioeconomic data
    from the year 1990 U.S. Census in ASCII and geotiff formats for 50 metropolitan
    statistical areas with at least one million in population. The grids have a resolution
    of 7.5 arc-seconds (0.002075 decimal degrees), or approximately 250 square meters.
    The gridded variables are based on census block geography from Census 1990 TIGER/Line
    Files and census variables (population, households, and housing variables). This
    data set is produced by the Columbia University Center for International Earth Science
    Information Network (CIESIN).",nt"license_title": "U.S. Government Work",nt"extras":
